import {createRoot} from 'rea'

import "./index.css"

function Header()
{
    return (
        <header id="header">
            <nav id = "img">
                <img src="/images/React.png" id= "img1"/>
                <h3>Pricing</h3>
                <h3>About</h3>
                <h3>Contact</h3>
            </nav>
        </header>
    )
}
function Head(){
    return(
        <h1>Reasons I'love React</h1>
    )
}
function List(){
    return(
        <ol>
            <li>It's a popular library so , I'll be able to fit in with the cool kids</li>
            <li>I'm more likely to get a job as a developer if I know React</li>
        </ol>
    )
}
function Footer(){
    return (
        <footer >
            <small>&copy;2021 Zollin development.All rights reserver.</small>
        </footer>
    )
}
function Page(){
    return(
        <div>
            <Header/> 
            <Head/> 
            <List/>
            <Footer/>
        </div>

    )
}


ReactDOM.render(<Page/>,document.getElementById('root'));
